import React from "react";
import "../../App.css";
import axios from "axios";
import { Link } from "react-router-dom";
import {
  ServiceRegistryGETAll,
  WeatherApiGETAll,
  SongApiGETAll,
} from "../../Constants";

export default function ServiceSelected() {
  React.useEffect(() => {
    axios.get(WeatherApiGETAll).then((response) => {
      console.log(response.data);
    });
  }, []);

  return (
    <div className="auth-wrapper">
      <div className="auth-inner">
        <form>
          <h3>Service End Points</h3>

          <div className="form-group">
            <label>Weather Api End Points</label>
          </div>

          <div className="form-group">
            <label>Song Api End Points</label>
          </div>
          <Link to="/service-endpoint">
            <button
              type="submit"
              className="btn btn-primary btn-block"
              //onClick={submit}
            >
              Submit
            </button>
          </Link>
        </form>
      </div>
    </div>
  );
}
